        // PUT: api/ProductsImages/5
        [RequireAdminToken]
        [ResponseType(typeof(void))]
        public async Task<IHttpActionResult> PutProductsImages(Guid id, ProductsImages productsImages)
        {
            if (!ModelState.IsValid)
            {
                return BadRequest(ModelState);
            }

            if (id != productsImages.Id)
            {
                return BadRequest();
            }

       //     db.Entry(productsImages).State = EntityState.Modified;

            try
            {
                await db.SaveChangesAsync();
            }
            catch (DbUpdateConcurrencyException)
            {
                if (!ProductsImagesExists(id))
                {
                    return NotFound();
                }
                else
                {
                    throw;
                }
            }

            return StatusCode(HttpStatusCode.NoContent);
        }

        // POST: api/ProductsImages
        [RequireAdminToken]
        [ResponseType(typeof(ProductsImages))]
        public void PostProductsImages(ProductsImages productsImages)
        {
            db.ProductsImages.Add(productsImages);

            try
            {
                db.SaveChanges();
            }
            catch (DbUpdateException)
            {
                if (ProductsImagesExists(productsImages.Id))
                {
                   // return Conflict();
                }
                else
                {
                    throw;
                }
            }
        }

        // DELETE: api/ProductsImages/5
        [RequireAdminToken]
        [ResponseType(typeof(ProductsImages))]
        public async Task<IHttpActionResult> DeleteProductsImages(Guid id)
        {
            ProductsImages productsImages = await db.ProductsImages.FindAsync(id);
            if (productsImages == null)
            {
                return NotFound();
            }

            db.ProductsImages.Remove(productsImages);
            await db.SaveChangesAsync();

            return Ok(productsImages);
        }

        protected override void Dispose(bool disposing)
        {
            if (disposing)
            {
                db.Dispose();
            }
            base.Dispose(disposing);
        }

        private bool ProductsImagesExists(Guid id)
        {
            return db.ProductsImages.Count(e => e.Id == id) > 0;
        }
    }
